import styles from "./Card.module.css";

const Card = (name, image) => {
  return (
    <figure className={className}>
      <img src={image} alt={name} className={styles.image}></img>
      <figcaption className={styles.name}>{name}</figcaption>
    </figure>
  );
};

export { Card };
